CoT_18:
# If today is the palindrome day of 2020, then the MMDDYYYY format of the date is the same backwards as forwards.
# Let's try to find which date satisfies the condition:
for i in range(1, 13):
    for j in range(1, 32):
        try:
            today = datetime(2020, i, j)
            if today.strftime('%m%d%Y') == today.strftime('%Y%d%m'):
                print(today.strftime('%m/%d/%Y'))
        except ValueError:
            continue
